import '../../index.css'
import styled from "styled-components"
import Button from '../../components/Button'

const SectionThird = () => {
    return (
        <Container>
            <Info>
                <Para>Vibrant, Complex & Intriguing</Para>
                <Title>CHAMISAL WINES</Title>
                <Text>We specialize in sustainably produced Chardonnay and Pinot Noir from Central Coast vineyards located between Monterey and Santa Barbara. Our wines are known for their intense flavor, mouthwatering texture, and impeccable balance. </Text>
                <Button value="DISCOVER"></Button>
            </Info>
            <ImagesTwo src="https://chamisalvineyards.com/wp-content/uploads/2018/06/home-content3.png" />
        </Container>
    )
}

const Para = styled.p`
    color: var(--color-darkGreen);
    letter-spacing: 2px;
    font-size: 1rem;
    line-height: 1.5;
    margin-bottom: 20px;
    text-transform: uppercase;
    font-weight: 600;
`

const Title = styled.h1`
    color: #404040;
    font-size: 55px;
    font-weight: 100;
    font-family: "Requiem",serif;
    letter-spacing: 3px;
    opacity: 0.9;
    margin-bottom: 20px;
`

const Text = styled.p`
    width: 70%;
    line-height: 1.7;
    font-size: 16px;
    color: var(--color-para);
    opacity: 0.8;
    margin-bottom: 40px;
`

export default SectionThird
